(1, 1, '2016-01-01 09:29:48', '2016-01-01 09:29:48', 'Живу в Индии на протяжении 7 ти месяцев. Живу в однокомнатной квартире с девочкой с Ассама. Я уже оплатила за аренду квартиры за 3 месяца вперед, недавно путешествовала в Ришекеш, Я уже была там раз, но решила еще раз вернуться в этот замечательный город, со своей незабываемой атмосферой. Это город расположен в северной Индии (штат Утаркханд), в предгорьях Гималаев, также известен как врата Гималаев. Я вернусь к этому позже со всеми <!--more-->подробными описаниями. Так вот не имея постоянной работы я живу в Дели и в принципе я не жалуюсь, даже наоборот рада что попала когда то сюда с девочками с сайта попутчиков. Не могу похвастаться тем что за тот период который я прожила тут у меня было больше событии, чем раньше. Я путешествую, я пишу блог, я хожу на разные светские тусовки, всегда есть деньги на карманные расходы и как это мне удается, вы можете прочитать в моих записках. Почему я делюсь с вами этим опытом, потому что раньше я жила такой жизнью как сейчас живут почти все мои знакомые. Офисный червь, человек который живет по стандартам, боясь поменять место проживания, думая что только у себя в стране можно жить и не тужить. Но оказалась не все так сложно, как казалось. Хочу на своем примере показать чтобы люди не боялись менять жизнь, а шли за своей мечтой и не гасили то желание которое не дает им спать по ночам. Тут я расскажу вам о людях, истории моих друзей, о работе, о новых впечатлениях, о культуре, о путешествиях с небольшим бюджетом в кармане и все это в невероятной стране-Индии.', 'Обо мне', '', 'trash', 'open', 'open', '', '%d0%bf%d1%80%d0%b8%d0%b2%d0%b5%d1%82-%d0%bc%d0%b8%d1%80', '', '', '2016-04-02 17:45:03', '2016-04-02 12:15:03', '', 0, 'http://localhost/wp/?p=1', 0, 'post', '', 1),
(2, 1, '2016-01-01 09:29:48', '2016-01-01 09:29:48', 'Это пример страницы. От записей в блоге она отличается тем, что остаётся на одном месте и отображается в меню сайта (в большинстве тем). На странице «Детали» владельцы сайтов обычно рассказывают о себе потенциальным посетителям. Например, так:\r\n<blockquote>Привет! Днём я курьер, а вечером — подающий надежды актёр. Это мой блог. Я живу в Ростове-на-Дону, люблю своего пса Джека и пинаколаду. (И ещё попадать под дождь.)</blockquote>\r\n...или так:\r\n<blockquote>Компания «Штучки XYZ» была основана в 1971 году и с тех пор производит качественные штучки. Компания находится в Готэм-сити, имеет штат из более чем 2000 сотрудников и приносит много пользы жителям Готэма.</blockquote>\r\nПерейдите <a href="http://localhost/wp/wp-admin/">в консоль</a>, чтобы удалить эту страницу и создать новые. Успехов!', 'Содержание', '', 'publish', 'open', 'open', '', 'sample-page', '', '', '2016-03-31 17:05:13', '2016-03-31 11:35:13', '', 0, 'http://localhost/wp/?page_id=2', 0, 'page', '', 0),
(11, 1, '2016-04-01 19:03:54', '2016-04-01 13:33:54', 'Живу в Индии на протяжении 7 ти месяцев. Живу в однокомнатной квартире с девочкой с Ассама. Я уже оплатила за аренду квартиры за 3 месяца вперед, недавно путешествовала в Ришекеш, Я уже была там раз, но решила еще раз вернуться в этот замечательный город, со своей незабываемой атмосферой. Это город расположен в северной Индии (штат Утаркханд), в предгорьях Гималаев, также известен как врата Гималаев. Я вернусь к этому позже со всеми подробными описаниями. Так вот не имея постоянной работы я живу в Дели и в принципе я не жалуюсь, даже наоборот рада что попала когда то сюда с девочками с сайта попутчиков. Не могу похвастаться тем что за тот период который я прожила тут у меня было больше событии, чем за мою 30-юю жизнь в моей стране. Я путешествую, я пишу блог, я хожу на разные светские тусовки, всегда есть деньги на карманные расходы и как это мне удается, вы можете прочитать в моих записках. Почему я делюсь с вами этим опытом, потому что раньше я жила такой жизнью как сейчас живут почти все мои знакомые. Офисный червь, человек который живет по стандартам, боясь поменять место проживания, думая что только у себя в стране можно жить и не тужить. Но оказалась не все так сложно, как казалось. Хочу на своем примере показать чтобы люди не боялись менять жизнь, а шли за своей мечтой и не гасили то желание которое не дает им спать по ночам. Тут я расскажу вам о людях, истории моих друзей, о работе, о новых впечатлениях, о культуре, о путешествиях с небольшим бюджетом в кармане и все это в невероятной стране Индии.', 'Обо мне', '', 'inherit', 'closed', 'closed', '', '1-autosave-v1', '', '', '2016-04-01 19:03:54', '2016-04-01 13:33:54', '', 1, 'http://localhost/wp/?p=11', 0, 'revision', '', 0),
(12, 1, '2016-03-31 15:31:21', '2016-03-31 10:01:21', 'Добро пожаловать в WordPress. Это ваша первая запись. Отредактируйте или удалите её, затем пишите!', 'Обо мне', '', 'inherit', 'closed', 'closed', '', '1-revision-v1', '', '', '2016-03-31 15:31:21', '2016-03-31 10:01:21', '', 1, 'http://localhost/wp/?p=12', 0, 'revision', '', 0),
(13, 1, '2016-03-31 16:58:53', '2016-03-31 11:28:53', 'Живу в Индии на протяжении 7 ти месяцев. Живу в однокомнатной квартире с девочкой с Ассама (люди с Северная Восточной части Индии отличаются внешностью и поведением от типичных индийцев). Я уже оплатила за аренду квартиры за 3 месяца вперед, недавно путешествовала в Ришекеш, Я уже была там раз, но решила еще раз вернуться в этот замечательный город, со своей незабываемой атмосферой. Это город расположен в северной Индии (штат Утаркханд), в предгорьях Гималаев, также известен как врата Гималаев. Я вернусь к этому позже со всеми подробными описаниями. Так вот не имея постоянной работы я живу и наслаждаюсь индийской жизнью. За тот период который я прожила тут у меня было больше событии чем я за последние 29 лет моей жизни в моей стране. Я путешествую, я пишу блог, я хожу на разные светские тусовки, всегда есть деньги на карманные расходы и как это мне удается, вы можете прочитать в моих записках. Почему я делюсь с вами этим опытом, потому что раньше я жила такой жизнью как сейчас живут почти все мои знакомые. Офисный червь, человек который живет по стандартам, боясь поменять место проживания, думая что только у себя в стране можно жить и не тужить. Но оказалась не все так сложно, как казалось. Хочу на своем примере показать чтобы люди не боялись менять жизнь, а шли за своей мечтой и не гасили то желание которое не дает им спать по ночам. Тут я расскажу вам о людях, о работе, о новых впечатлениях, о культуре, о путешествиях с не очень большим бюджетом в кармане и все это в невероятной стране Индии.', 'Обо мне', '', 'inherit', 'closed', 'closed', '', '1-revision-v1', '', '', '2016-03-31 16:58:53', '2016-03-31 11:28:53', '', 1, 'http://localhost/wp/?p=13', 0, 'revision', '', 0),
(14, 1, '2016-03-31 17:05:13', '2016-03-31 11:35:13', 'Это пример страницы. От записей в блоге она отличается тем, что остаётся на одном месте и отображается в меню сайта (в большинстве тем). На странице «Детали» владельцы сайтов обычно рассказывают о себе потенциальным посетителям. Например, так:\r\n<blockquote>Привет! Днём я курьер, а вечером — подающий надежды актёр. Это мой блог. Я живу в Ростове-на-Дону, люблю своего пса Джека и пинаколаду. (И ещё попадать под дождь.)</blockquote>\r\n...или так:\r\n<blockquote>Компания «Штучки XYZ» была основана в 1971 году и с тех пор производит качественные штучки. Компания находится в Готэм-сити, имеет штат из более чем 2000 сотрудников и приносит много пользы жителям Готэма.</blockquote>\r\nПерейдите <a href="http://localhost/wp/wp-admin/">в консоль</a>, чтобы удалить эту страницу и создать новые. Успехов!', 'Содержание', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2016-03-31 17:05:13', '2016-03-31 11:35:13', '', 2, 'http://localhost/wp/?p=14', 0, 'revision', '', 0),
