(41, 1, '2016-04-02 17:18:27', '2016-04-02 11:48:27', 'Живу в Индии на<img class="size-medium wp-image-67 alignleft" src="http://localhost/wp/wp-content/uploads/2016/04/photo-1414495984329-50d61ce35d7e_mini-300x200.jpg" alt="photo-1414495984329-50d61ce35d7e_mini" width="300" height="200" /> протяжении 7 ти месяцев. Живу в однокомнатной квартире с девочкой с Ассама. Я уже оплатила за аренду квартиры за 3 месяца вперед, недавно путешествовала в Ришекеш, Я уже была там раз, но решила еще раз вернуться в этот замечательный город, со своей незабываемой атмосферой. Это город расположен в северной Индии (штат Утаркханд), в предгорьях Гималаев, также известен как врата Гималаев. Я вернусь к этому позже со всеми подробными описаниями. Так вот не имея постоянной работы я живу в Дели и в принципе я не жалуюсь, даже наоборот рада что попала когда то сюда с девочками с сайта попутчиков. Не могу похвастаться тем что за тот период который я прожила тут у меня было больше событии, чем раньше. Я путешествую, я пишу блог, я хожу на разные светские тусовки, всегда есть деньги на карманные расходы и как это мне удается, вы можете прочитать в моих записках. Почему я делюсь с вами этим опытом, потому что раньше я жила такой жизнью как сейчас живут почти все мои знакомые. Офисный червь, человек который живет по стандартам, боясь поменять место проживания, думая что только у себя в стране можно жить и не тужить. Но оказалась не все так сложно, как казалось. Хочу на своем примере показать чтобы люди не боялись менять жизнь, а шли за своей мечтой и не гасили то желание которое не дает им спать по ночам. Тут я расскажу вам о людях, истории моих друзей, о работе, о новых впечатлениях, о культуре, о путешествиях с небольшим бюджетом в кармане и все это в невероятной стране-Индии.', 'Обо мне', '', 'publish', 'closed', 'closed', '', 'obo-mne', '', '', '2016-04-09 20:12:58', '2016-04-09 14:42:58', '', 0, 'http://localhost/wp/?page_id=41', 0, 'page', '', 0),
