(111, 1, '2016-04-09 20:14:26', '2016-04-09 14:44:26', 'I have been living in India for 8 months. I am living in a studio apartment with a girl from Assam. It is my very close friend, and she''s just a very nice person. Payment for rent apartments in 3 months in advance, I traveled to a small trip in Rishekesh, I''ve been there once, but decided to return once again to this wonderful city, with its unforgettable atmosphere. It is a city located in northern India (State Utarkhand), in the foothills of the Himalayas, also known as the gate of the Himalayas. I''ll come back to it later with all detailed descriptions. So not having a permanent job, I live in New Delhi and in principle I am not complaining, quite the contrary is pleased that when it came here with the girls for travel from the site. I can not boast that during the period that I have lived here I have had more events than ever before. I''m traveling, I write a blog, I go to different socal parties, there is always some pocket money and how I manage, you can read in my notes. Why do I share this experience with you, because I used to live such a life as it is now live almost all my friends. Office worm, a man who lives according to the standards, fear of change place of residence, thinking that only in their own country to live and not to grieve. But all was not as difficult as it seemed. I want to show by example that people are not afraid to change the lives and going for your dreams and do not quenched the desire that keeps them awake at night. Here I will tell you about the people, the history of my friends about the work of the new experiences, culture, travel on a budget in your pocket and all this in an incredible country India.\r\n', 'About me', '', 'publish', 'closed', 'closed', '', '111-2', '', '', '2016-04-10 16:51:52', '2016-04-10 11:21:52', '', 0, 'http://localhost/wp/?page_id=111', 0, 'page', '', 0),
